import React from "react";
import Router from "./Router";
import "./assets/style.css";
import Home from "../src/containers/Home";
import { Routes } from "react-router-dom";

function App() {
  // return <Router />;
  // <Home />

  <Router>
    <Routes exact path={"/"} component={Home} />
  </Router>;
}

export default App;
